import React, { useEffect } from "react";

import '../../normalize.scss';
import '../../base.scss';

import Termos from '../../components/Cadastro/Termos';
import View from "../view/view";
import { useHistory } from "react-router-dom";

function TermosCadastro() {
    const history = useHistory();
    const is_cadastro = props.history.location.state
    console.log(is_cadastro)

      useEffect(() => {
        if(is_cadastro === undefined || null) {
          history.push("/");
        }
        // eslint-disable-next-line
      },[]);

  return (
    <View cadastro={true}>
      <Termos />
    </View>
  )
} 

export default TermosCadastro;
